INSERT INTO `races` VALUES (11,'Virtual Race With Camp Sunshine','2013-07-28','2013-09-07','2013-12-22 08:01:00','2014-01-01 04:59:00','2013-07-14 04:15:26','2013-09-08 15:58:00',NULL,0,'PhantomRunner_CampSunshineBanner.jpg','image/jpeg',241549,'2013-07-22 23:46:54','<h3><span style=\"color:#FF0000;\">REGISTATION WILL REOPEN SHORTLY. &nbsp;We are working out new race options and lowering the entry fee. &nbsp;Check back soon!</span></h3>\r\n\r\n<h3>What&#39;s Included:<img alt=\"PhantomRunner Virtual Race With Camp Sunshine\" src=\"/ckeditor_assets/pictures/34/content_shirt2.jpg\" style=\"width: 230px; height: 204px; float: right; margin-left: 20px; margin-right: 20px;\" /><img alt=\"PhantomRunner Virtual Race With Camp Sunshine\" src=\"/ckeditor_assets/pictures/38/content_phantomrunner_campsunshinefinishermedal.png\" style=\"width: 200px; height: 200px; float: right;\" /></h3>\r\n\r\n<ol>\r\n	<li>T-Shirt With Race Logo</li>\r\n	<li>Finisher&#39;s Medal With Race Logo</li>\r\n	<li>Digital Badge With Race Logo</li>\r\n	<li>Race Bib With Race Logo</li>\r\n</ol>\r\n\r\n<h3>Contribution:</h3>\r\n\r\n<p><span style=\"line-height: 1.6em;\">10% of the entry fees collected will be donated to <a href=\"http://www.campsunshine.org/\" target=\"_blank\">Camp Sunshine</a>. &nbsp;When you get a friend to sign up by using the &quot;Refer A Friend&quot; button on this page, an additional 5% from each of your entry fees will be given (for a total of 15%). &nbsp;You&nbsp;can make an&nbsp;additional contribution&nbsp;to Camp Sunshine by using the &quot;Donate&quot; button on this page. &nbsp;You can also make a one-time donation of $10 by texting CAMP to 20222.</span></p>\r\n\r\n<h3><span style=\"line-height: 1.6em;\">About Camp Sunshine:</span></h3>\r\n\r\n<p><img alt=\"Camp Sunshine Charity Navigator\" src=\"/ckeditor_assets/pictures/33/content_cs4star.jpg\" style=\"width: 150px; height: 129px; float: left; margin-left: 10px; margin-right: 10px;\" />Camp Sunshine is a 501(c)(3) non-profit that provides a summer camp experience for children with life-threatening illnesses and their families. &nbsp;They rely on voluntary donations and fundraising events to provide their program free-of-charge. &nbsp;&quot;Camp&quot; is located in Casco, Maine. &nbsp;You can learn more&nbsp;by visiting the <a href=\"http://www.campsunshine.org/\" target=\"_blank\">Camp Sunshine website</a>.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n',2,0,0,0,60,'26.99','29.99','2013-08-31',3,1,'',1,'PhantomRunner','director@phantomrunner.com','http://www.phantomrunner.com','PRVirtualracing','phantomrunner6','Fun Walk, 1 Mile, 5K, 10K, And Half Marathon Virtual Race - 10% Of Entry Fees Go To Camp Sunshine - T-shirt, Medal, Digital Badge, Race Bib','Camp Sunshine','http://www.campsunshine.org/support_us/donations/index.php',0,0,'0.00'),(16,'Virtual Race For SOWF','2013-07-29','2013-11-30','2013-11-23 08:01:00','2013-12-01 04:59:00','2013-07-30 15:30:38','2013-09-08 14:58:12',NULL,0,'PhantomRunnerCharityBanners.jpg','image/jpeg',239628,'2013-07-30 15:44:50','<h3>What&#39;s Included:<img alt=\"PhantomRunner Virtual Race For SOWF\" src=\"/ckeditor_assets/pictures/37/content_shirt1.jpg\" style=\"width: 230px; height: 204px; margin-left: 20px; margin-right: 20px; float: right;\" /><img alt=\"PhantomRunner Virtual Race For SOWF\" src=\"/ckeditor_assets/pictures/36/content_phantomrunner_sowffinishermedal.jpg\" style=\"width: 200px; height: 200px; float: right;\" /></h3>\r\n\r\n<ol>\r\n	<li>T-Shirt With Race Logo</li>\r\n	<li>Finisher&#39;s Medal With Race Logo</li>\r\n	<li>Digital Badge With Race Logo</li>\r\n	<li>Race Bib With Race Logo</li>\r\n</ol>\r\n\r\n<h3>Contribution:</h3>\r\n\r\n<p><span style=\"line-height: 1.6em;\">10% of the entry fees collected will be donated to <a href=\"http://www.specialops.org/\" target=\"_blank\">Special Operations Warrior Foundation</a>. &nbsp;When you get a friend to sign up by using the &quot;Refer A Friend&quot; feature, an additional 5% from each of your entry fees will be given (for a total of 15%). &nbsp;You can make an additional contribution&nbsp;to SOWF&nbsp;by using the &quot;Donate&quot; button on this page.</span></p>\r\n\r\n<h3><span style=\"line-height: 1.6em;\">About Special Operations Warrior Foundation:</span></h3>\r\n\r\n<p><a href=\"http://www.specialops.org/?page=AbouttheFoundation\" target=\"_blank\"><img alt=\"SOWF Charity Navigator\" src=\"/ckeditor_assets/pictures/35/content_4starcharitynavigatorsowf.jpg\" style=\"width: 130px; height: 127px; margin-left: 10px; margin-right: 10px; float: left;\" /></a>Special Operations Warrior Foundation is a 501(c)(3) non-profit. &nbsp;SOWF ensures full scholarship grants as well as educational and family counseling to the surviving children of Army, Navy, Air Force, and Marine special operations personnel who lose their lives in the line of duty, and provides immediate financial assistance for severely wounded special operations personnel and their families.<span style=\"font-size: 13px; line-height: 1.6em;\">&nbsp; </span>You can learn more&nbsp;by visiting the <a href=\"http://www.specialops.org/\" target=\"_blank\">Special Operations Warrior Foundation website</a>.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n',2,0,0,0,60,'26.99','29.99','2013-08-31',3,1,'',1,'PhantomRunner','director@phantomrunner.com','http://www.phantomrunner.com','PRvirtualracing','phantomrunner6','Fun Walk, 1 Mile, 5K, 10K, and Half Marathon virtual races - T-shirt, Medal, Digital Badge, and Race Bib - 10% of total entry fee goes to SOWF.','Special Operations Warrior Foundation','https://www.givedirect.org/give/givefrm.asp?CID=789',0,0,'0.00'),(17,'Community 5K','2013-08-06','2013-08-11','2013-08-07 04:01:00','2013-08-12 03:59:00','2013-08-06 16:52:24','2013-09-03 16:05:37',NULL,0,'PhantomRunner5k.jpg','image/jpeg',285532,'2013-08-06 17:06:53','<h2>Weekly FREE&nbsp;virtual 5K for the PhantomRunner community.</h2>\r\n\r\n<p><span