ual 5k / 10k / Half-Marathon.&nbsp;</span><a href=\"http://www.compassion.com/\" style=\"color: rgb(59, 153, 176); text-decoration: none; font-family: \'Myriad Pro\', Arial, Helvetica, sans-serif; font-size: 14px; line-height: 21px;\">Compassion International</a><span style=\"color: rgb(102, 102, 102); font-family: \'Myriad Pro\', Arial, Helvetica, sans-serif; font-size: 14px; line-height: 21px;\">&nbsp;is a&nbsp;Christian child advocacy ministry that was founded in 1952. They currently&nbsp;help more than&nbsp;1.2 million children in 26 countries. This is a fantastic charity to support because&nbsp;</span><a href=\"http://www.compassion.com/about/financial.htm\" style=\"color: rgb(59, 153, 176); text-decoration: none; font-family: \'Myriad Pro\', Arial, Helvetica, sans-serif; font-size: 14px; line-height: 21px;\" target=\"_blank\">over 80% of their expenditures</a><span style=\"color: rgb(102, 102, 102); font-family: \'Myriad Pro\', Arial, Helvetica, sans-serif; font-size: 14px; line-height: 21px;\">&nbsp;go towards program activities for the children. They have a 4-star rating on&nbsp;</span><a href=\"http://www.charitynavigator.org/index.cfm?bay=search.summary&amp;orgid=3555#.Uhwc_tJwr6U\" style=\"color: rgb(59, 153, 176); text-decoration: none; font-family: \'Myriad Pro\', Arial, Helvetica, sans-serif; font-size: 14px; line-height: 21px;\" target=\"_blank\">Charity Navigator.</a></p>\r\n\r\n<p><br style=\"color: rgb(102, 102, 102); font-family: \'Myriad Pro\', Arial, Helvetica, sans-serif; font-size: 14px; line-height: 21px;\" />\r\n<span style=\"color: rgb(102, 102, 102); font-family: \'Myriad Pro\', Arial, Helvetica, sans-serif; font-size: 14px; line-height: 21px;\">The funds raised from this virtual run will benefit Compassion International&#39;s &quot;</span><a href=\"http://www.compassion.com/highly-vulnerable-children.htm\" style=\"color: rgb(59, 153, 176); text-decoration: none; font-family: \'Myriad Pro\', Arial, Helvetica, sans-serif; font-size: 14px; line-height: 21px;\" target=\"_blank\">Highly Vulnerable Children</a><span style=\"color: rgb(102, 102, 102); font-family: \'Myriad Pro\', Arial, Helvetica, sans-serif; font-size: 14px; line-height: 21px;\">&quot; fund.&nbsp;</span><span style=\"color: rgb(102, 102, 102); font-size: 14px; line-height: 1.5; font-family: Arial, Helvetica, sans-serif;\">This fund offers a lifeline to children facing almost unimaginable hardship.&nbsp;Assistance provided these children varies, depending upon their individual needs, but can include foster care, trauma counseling, legal assistance, and shelter renovations.</span><br style=\"color: rgb(102, 102, 102); font-family: \'Myriad Pro\', Arial, Helvetica, sans-serif; font-size: 14px; line-height: 21px;\" />\r\n<br style=\"color: rgb(102, 102, 102); font-family: \'Myriad Pro\', Arial, Helvetica, sans-serif; font-size: 14px; line-height: 21px;\" />\r\n<span style=\"color: rgb(102, 102, 102); font-family: \'Myriad Pro\', Arial, Helvetica, sans-serif; font-size: 14px; line-height: 21px;\">This virtual run is scheduled for January 2014. You can view more info on this run here: <a href=\"http://compassionrocks.weebly.com/\">http://compassionrocks.weebly.com</a>.</span></p>\r\n',2,0,0,0,60,'20.00','20.00',NULL,116,1,'',1,'Amber Jordan','aj107527@windstream.net','http://compassionrocks.weebly.com/','events/226824104137874/','','The funds raised from this virtual run will provide foster care, trauma counseling, legal assistance, and shelter renovations for children in poverty. ','Compassion International - Highly Vulnerable Children Fund','http://www.compassion.com/donate.htm',1,1,'0.00'),(26,'Lake Cumberland Living Run/ Walk',NULL,NULL,NULL,NULL,'2013-08-27 22:12:14','2013-08-27 22:12:14',NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,60,NULL,NULL,NULL,189,0,NULL,NULL,'LakeCumberlandLiving.com','info@lakecumberlandliving.com','http://www.lakecumberlandliving.com','lakecumberlandliving','lakecliving','Run or Walk any distance you like. ','still